window.bookSummaryJSON = "<p>Justan's time in Malaroo isn't going well. A deadly shape-shifting assassin seeks his life, and he is struggling to win over Jhonate's father. </p> <p>Fist is the only ogre ever to train at the Mage School. He is determined to make the most of this opportunity, but his plans are derailed and his burgeoning powers tested when he receives a visit from the tribe he had long thought dead. </p> <p>An army closes in on the grove, a new race of monsters emerges from the swamps, and a great evil grows in the mountains. The survival of the known lands may depend on the strength of the ogre apprentice. </p>"; 
